import React from "react";
import "./courseBox.scss";
const CourseBox = ({courseName, imgUrl}) => {
  return (
    <div className="courseBox">
      <h2>course 1</h2>
      <img src={process.env.PUBLIC_URL +"/images/peter-wendt--r5KSMkyoSc-unsplash.jpg/"}/>
    </div>
  );
};

export default CourseBox;
